import React from 'react';
// import { FaThumbsUp, FaComment, FaShare } from 'react-icons/fa';
import '../assets/styles/Post.css';

const Post = ({ post }) => (
  <div className="post">
    <div className="post-header">
      <div className="profile-picture"></div>
      <div className="post-user-details">
        <h3>{post.username}</h3>
        <p>{post.time}</p>
      </div>
    </div>
    <div className="post-content">
      <p>{post.content}</p>
    </div>
    <div className="post-footer">
      {/* <button className="post-button"><FaThumbsUp /> Like</button>
      <button className="post-button"><FaComment /> Comment</button>
      <button className="post-button"><FaShare /> Share</button> */}
      <button className="post-button"> Like</button>
      <button className="post-button"> Comment</button>
      <button className="post-button"> Share</button>
    </div>
  </div>
);

export default Post;
